import React, { Component } from 'react'

export default class Button extends Component {
  state = {
    clicked:false
  };
  bodyStyle = {
    textAlign:"center",
    backgroundColor:"Black",
    color:"white"
  };
  spanStyle = {
    margin:25
  };
  render() {
    return (
      <div className="bg bg-red text-center text-secondary">
        <h1>Welcome to the NBA Fantasy Ranking Calculator</h1>
        <div>
          <button className="btn btn-primary btn-sm">Official Fantasy Rules</button>
          <span style={this.spanStyle}></span>
          <button className="btn btn-primary btn-sm">Custom Fantasy Rules</button>
        </div>
      </div>
    )
  }
}
